import React from 'react';
import textBoxStyle from './text-box.module.scss';

interface OwnProps {
    height: string,
    width: string
}

type Props = OwnProps;
const TextBox: React.FC<Props> = (props) => {
    return (
        <div className={textBoxStyle.Box} style={{ height: props.height, width: props.width }}>
            <div className={textBoxStyle.Icon}>אייקון</div>

            <div className={textBoxStyle.Text}>
                <div className={textBoxStyle.Title}>כותרת</div>
                <div className={textBoxStyle.Content}>מידע מידע מידע</div>
            </div>

        </div>
    )
}

export default TextBox;
